import React,{useState} from 'react'

function Note(props) {
    const [notes, setNotes] = useState([
        {
            id:1,
            title:"title1",
            content:"content1"
        },
        {
            id:2,
            title:"title2",
            content:"content2"
        },
        {
            id:1,
            title:"title1",
            content:"content1"
        },
    ])
  return (
    <h2 className='note'>{props.children}</h2>
  )
}

export default Note
